import { useEffect, useState } from "react";
import Layout from "../Layout";
import axios from "axios";

function BlogLists() {
    return (
        <>
        <Layout/>
        <div id = "admin-bl-div">
            <p>All blogs</p>
            <div id = "admin-bl-inside-div">
                <table>
                    <thead>
                        <tr>
                            <th></th>
                        </tr>
                    </thead>
                </table>
            </div>
        </div>
        </>
    )
}

export default BlogLists;
